import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { ChakraProvider } from "@chakra-ui/react";

ReactDOM.render(
  <ChakraProvider maxW='container.md'>
    <React.StrictMode>
      <App />
    </React.StrictMode>

  </ChakraProvider>
  , document.getElementById('root')
);
